.collaborate {
  background-image: url("https://res.cloudinary.com/dn0br7hj0/image/upload/background/Background2.webp");
  background-repeat: repeat;
  background-position: top center;
  background-size: 300px;
  image-rendering: -webkit-optimize-contrast;
  image-rendering: crisp-edges;
  padding: 40px 0;
  min-height: 100vh;
  display: flex;
  align-items: center;
  position: relative;
}

.collaborate-container {
  max-width: 1200px;
  margin: 0 auto;
  width: 100%;
  padding: 0 20px;
}

.collaborate-header {
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 60px;
}

.collaborate-title {
  font-family: "Meholrax", serif;
  font-size: 2.5rem;
  color: #000;
  margin: 0;
}

.collaborate-view-all {
  font-family: "Roboto", sans-serif;
  font-size: 1rem;
  color: #000;
  text-decoration: none;
  display: flex;
  align-items: center;
  gap: 5px;
  transition: opacity 0.3s ease;
}

.collaborate-view-all:hover {
  opacity: 0.7;
}

.collaborate-view-all svg {
  font-size: 1.5rem;
}

.slideshow-container {
  position: relative;
  overflow: hidden;
  margin: 0 -20px;
}

.slides-wrapper {
  display: flex;
  transition: transform 0.5s ease;
}

.slide {
  min-width: 100%;
}

.slide-image-container {
  width: 100%;
  aspect-ratio: 16/9;
  overflow: hidden;
  position: relative;
}

.slide-image-container::after {
  content: "";
  position: absolute;
  bottom: 0;
  left: 0;
  width: 100%;
  height: 50%;
  background: linear-gradient(to top, rgba(0, 0, 0, 0.7), transparent);
  pointer-events: none;
}

.slide-image {
  width: 100%;
  height: 100%;
  object-fit: cover;
  transition: transform 0.3s ease;
}

.slide:hover .slide-image {
  transform: scale(1.05);
}

.slide-title {
  font-family: "Roboto", sans-serif;
  font-size: 1.5rem;
  color: #fff;
  margin: 0;
  position: absolute;
  bottom: 30px;
  left: 30px;
  z-index: 2;
  text-align: left;
  font-weight: 300;
}

.dots-navigation {
  display: flex;
  justify-content: center;
  gap: 10px;
  margin-top: 40px;
}

.dot {
  width: 10px;
  height: 10px;
  border-radius: 50%;
  background-color: #ccc;
  border: none;
  padding: 0;
  cursor: pointer;
  transition: background-color 0.3s ease;
}

.dot.active {
  background-color: #000;
}

/* Responsive styles */
@media (max-width: 768px) {
  .collaborate {
    padding: 60px 0;
  }

  .collaborate-title {
    font-size: 2rem;
  }

  .slide-title {
    font-size: 1.3rem;
    bottom: 20px;
    left: 20px;
  }
}

@media (max-width: 480px) {
  .collaborate {
    padding: 40px 0;
  }

  .collaborate-title {
    font-size: 1.8rem;
  }

  .collaborate-view-all {
    font-size: 0.9rem;
  }

  .slide-title {
    font-size: 1.8rem;
    bottom: 100px;
    left: 80px;
  }
}

/* Desktop styles */
@media (min-width: 769px) {
  .collaborate-container {
    max-width: 1400px;
    padding: 0 60px;
    position: relative;
    z-index: 1;
  }

  .collaborate-header {
    margin-bottom: 80px;
  }

  .collaborate-title {
    font-size: 4rem;
    position: relative;
    display: inline-block;
  }

  .collaborate-title::after {
    content: "";
    position: absolute;
    bottom: -15px;
    left: 0;
    width: 120px;
    height: 4px;
    background: linear-gradient(90deg, #000 0%, transparent 100%);
  }

  .collaborate-view-all {
    font-size: 1.2rem;
    padding: 12px 25px;
    border: 1px solid rgba(0, 0, 0, 0.1);
    border-radius: 30px;
    transition: all 0.4s ease;
  }

  .collaborate-view-all:hover {
    background: #000;
    color: #fff;
    opacity: 1;
    transform: translateY(-2px);
    box-shadow: 0 10px 20px rgba(0, 0, 0, 0.1);
  }

  .collaborate-view-all svg {
    font-size: 1.8rem;
    transition: transform 0.4s ease;
  }

  .collaborate-view-all:hover svg {
    transform: translateX(5px);
    color: #fff;
  }

  .slideshow-container {
    margin: 0 -30px;
  }

  .slides-wrapper {
    display: grid;
    grid-template-columns: repeat(4, 1fr);
    gap: 30px;
    transform: none !important;
  }

  .slide {
    min-width: auto;
    opacity: 0.9;
    transition: all 0.4s ease;
  }

  .slide:hover {
    opacity: 1;
    transform: translateY(-10px);
  }

  .slide-image-container {
    aspect-ratio: 2/3;
    border-radius: 20px;
    overflow: hidden;
    box-shadow: 0 15px 30px rgba(0, 0, 0, 0.1);
    transition: all 0.4s ease;
  }

  .slide:hover .slide-image-container {
    box-shadow: 0 20px 40px rgba(0, 0, 0, 0.2);
  }

  .slide-image-container::after {
    background: linear-gradient(
      to top,
      rgba(0, 0, 0, 0.8) 0%,
      rgba(0, 0, 0, 0.4) 30%,
      transparent 100%
    );
    height: 70%;
    transition: all 0.4s ease;
  }

  .slide:hover .slide-image-container::after {
    height: 100%;
    background: linear-gradient(
      to top,
      rgba(0, 0, 0, 0.9) 0%,
      rgba(0, 0, 0, 0.5) 50%,
      rgba(0, 0, 0, 0.3) 100%
    );
  }

  .slide-title {
    font-size: 1.8rem;
    bottom: 40px;
    left: 50%;
    transform: translateX(-50%);
    text-align: center;
    width: 80%;
    font-weight: 400;
    opacity: 0;
    transition: all 0.4s ease;
  }

  .slide:hover .slide-title {
    opacity: 1;
    transform: translate(-50%, -20px);
  }

  .dots-navigation {
    display: none;
  }
}
